puts "## \uc0\u55357 \u56445  About Me:  "\
puts\
puts\
puts "I am a professional in career transition with a strong background and experience in Graphic Design, and I am directing my focus towards Front-End Development, AI and Data Science. Additionally, I hold a degree in Psychology from PUC-SP and seek to integrate my knowledge from both fields to create innovative and impactful digital solutions. Furthermore, after graduating, I had the opportunity to study at UCSD-California, where I attended the American Language Institute to enhance my fluency in English, followed by the Graphic Design course."\
puts\
puts "Constantly seeking to improve my skills and explore new opportunities in the world of technology, I decided to take a step forward and embark on my academic journey at Impacta Tecnologia University, pursuing a degree in Analysis and Systems Development (ASD) in S\'e3o Paulo."\
puts\
puts "Combining my passion for design and my growing proficiency in Front-End Development, my aim is to build a career that brings together the best of both worlds, providing incredible and functional digital experiences."\
puts\
puts "I am excited about the possibility of growing and evolving in the technology field, and I am determined to explore new horizons, embracing the challenges that Quantum Computing and Software Development can offer."\
puts\
puts "## \uc0\u55358 \u56792 \u55356 \u57340 \u8205 \u9792 \u65039  Professional Focus:"\
puts\
puts "I seek to integrate my knowledge in Graphic Design, Front-End Development, and soon, in Quantum Computing, to create innovative and impactful solutions in the digital world. I am enthusiastic about the possibilities that this combination of skills can provide and eager to contribute to projects and teams that share this vision."\
puts\
puts "## \uc0\u55357 \u56384  Future Objectives:"\
puts\
puts "My goal is not only to become a standout professional in the Software Development field but also to be part of the constantly evolving movement in Quantum Computing. Through continuous education, hard work, and collaboration with other technology enthusiasts."\
puts\
puts "I aspire to drive innovation and contribute to the advancement of science and quantum computing for the benefit of humanity."\
